import Vue from "vue";
import FullCalendar from "@fullcalendar/vue";
import dayGridPlugin from "@fullcalendar/daygrid";
import timeGridPlugin from "@fullcalendar/timegrid";
import InteractionPlugin from "@fullcalendar/interaction";
import viPlugin from "@fullcalendar/core/locales/vi";
import EventOwnerTypes from "@/components/Calendar/EventOwnerOptions";
import {fauth} from "@/firebase";
import {mapGetters} from "vuex";
// import "@/assets/candidate_info_modal.js";

export default Vue.extend({
    props: {},
    components: {
        FullCalendar
    },
    data() {
        return {
            calendarPlugins: [dayGridPlugin, timeGridPlugin, InteractionPlugin],
            viPlugin,
            calendarHeader: {
                left: "today prev,next",
                center: "title",
                right: "dayGridMonth,timeGridWeek,timeGridDay"
            },

            event_owner_filters: "",
            event_owner_options: EventOwnerTypes,

            newEvent: {
                startStr: "",
                endStr: ""
            },
            allEvents: [
                {
                    title: "My Event",
                    assigned: {
                        id: "asdasdasd",
                        name: "An",
                        position_id: "123"
                    },
                    start: "2019-04-19 9:00 (GMT+7)",
                    end: "2019-04-23 15:30 (GMT+7)",
                    // allDay: true,
                    color: "blue",
                    textColor: "white",
                    editable: true,
                    id: "asdasd"
                },
                {
                    title: "Dinh's Event",
                    assigned: {
                        id: "dsadasdsa",
                        name: "Hong Viet Le",
                        position_id: "456"
                    },
                    start: "2019-04-15 11:30 (GMT+7)",
                    end: "2019-04-15 15:30 (GMT+7)",
                    color: "green",
                    textColor: "white",
                    id: "abcabcbac"
                }
            ],

            // TEST DATA
            positions: [
                {
                    id: "123",
                    name: "Dev"
                },
                {
                    id: "456",
                    name: "Tester"
                }
            ],
            position_filters: [] as string[]
        };
    },
    computed: {
        // mix the getters into computed with object spread operator
        ...mapGetters([
            "currentUser",
            "currentCompany"
            // ...
        ])
    },
    created() {
        console.info("candidateModal.vue");
    },
    methods: {}
});
